<#
.EXAMPLE
    $s = Invoke-Command -ComputerName <remote host> -Filepath .\Check-FileSignature.ps1 -ArgumentList @('C:\Windows\System32\sethc.exe')
    $s

.SYNOPSIS
    Check to see if a file is digitally signed (catalog or embedded)

.DESCRIPTION
    Check to see if a file is digitally signed (catalog or embedded)

#>

Param
(
    [string]$file
)

$temppath = "$env:temp\sigcheck.exe"
$B64 = ""

# If Windows 10
if ([Environment]::OSVersion.version.major -eq '10'){
    Get-AuthenticodeSignature $file | select *
}

# If other
else{
    $Content = [System.Convert]::FromBase64String($B64)
    Set-Content -Path $temppath -Value $Content -Encoding Byte
    & $temppath -nobanner -accepteula $file
    Remove-Item $temppath
}